import React, { Component } from "react";
import axios from "axios";
import { faEnvelope } from "@fortawesome/free-regular-svg-icons";
import { faLock } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import "../shared/App.css";
import './Main.css'

class Dance extends Component {
  constructor(props) {
    super(props);
    this.state = {
      file: '',
      name: '',
    };
    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleChange = this.handleChange.bind(this);
  }
  handleChange(event) {
    const target = event.target;
    this.setState({
      [target.name]: target.value,
    });
  }
  handleSubmit(event) {
    event.preventDefault();
    console.log("[Music.js] Call");
    axios
      .post("http://localhost:8000/dance/", {
        file: this.state.file,
        name: this.state.name,
      })
      .then((response) => {
        console.log(response.data);
        this.props.history.push("/dance/");
      });
  }
  
  
  render() {
    return (
      <section className="div-beige">
        <div className="hero-body">
          <div className="container">
              <div className="title1">
                  안무 보기
                </div>
                
              
            </div>
          </div>
<div className="danceDiv">
  <p className="dancetitle">Afterlike</p>
  <p className="dancetitle">2022/12/19</p>
</div>
<div className="danceDiv1">
<p className="dancetitle">Dreamers</p>
  <p className="dancetitle">2022/12/28</p>
</div>
         
      </section>
    );
  }
}

  
export default Dance;
